    "definition": "A tuft cell that is part of the epithelium of the submandibular gland, localized to the striated ducts in mice, pigs, and humans, and to the main excretory ducts in rats. This cell is characterized by chemosensory functions, potential roles in immune regulation, and possible involvement in salivary secretion via acetylcholine release.",
