    "label": "tanycyte of vascular organ of lamina terminalis",
    "definition": "A specialized, non-ciliated ependymal glial cell located in the ventricular wall of the organum vasculosum of the lamina terminalis (OVLT) and characterized by elongated basal processes extending into the parenchyma to contact fenestrated capillaries. In mice, it is characterised by the expression of tight junction proteins (claudin 1, occludin, ZO-1) forming a continuous honeycomb junctional pattern. This cell contributes to a functional blood\u2013cerebrospinal fluid (CSF) barrier at the ventricular interface of the OVLT.",
