    "label": "monocyte-derived Kupffer cell",
    "definition": "A Kupffer cell located within the hepatic sinusoids, derived from circulating bone marrow monocytes that acquire the phenotypic markers and functional properties of resident Kupffer cells through niche-dependent imprinting, typically following depletion of the embryonically derived Kupffer cell population. During liver injury, MoKCs become the dominant Kupffer cell subset, exhibiting enhanced proliferation, resistance to apoptosis, and key roles in tissue repair and fibrosis attenuation.",
